#      executor: docker
#      docker_image: ruby:2.1
#      env:
#        SECRET_NUMBER: 42
#    - tags:
#        - dnd
#      cache_shared:
#        server_address: s3://my-s3-gateway
#        access_key: secret-access-key
#        bucket_name: my-unique-bucket-name
#        bucket_location: us-east-2
#      executor: docker
#      docker_image: docker:stable
